var EventEmitter = function () {
    this.listeners = {};
};

EventEmitter.prototype.subscribe = function (eventName, fn) {
    if (!(eventName in this.listeners)) {
        this.listeners[eventName] = [];
    }

    this.listeners[eventName].push(fn);

    return (function unsibscribe() {
        var index = this.listeners[eventName].indexOf(fn);
        this.listeners[eventName].splice(index, 1);
    }).bind(this);
};

EventEmitter.prototype.publish = function (eventName, data) {
    if (eventName in this.listeners) {
        this.listeners[eventName].map(function (fn) {
            return fn(data);
        });
    }
};



