    setGAAddToCartImpressionEvent: function(productId) {
        try {
            var productData = Services.retrieveProductFromDataLayer({
                productId: productId,
                eventName: 'eec.productDetail',
                pathArray: ['ecommerce','detail','products']
            });

            var previousPage = document.referrer;
            var impressionObject = createImpressionObj(productData, Main.getGaListName(previousPage));

            window.dataLayer.push(impressionObject);
        } catch (e) {
            // window.Sentry && window.Sentry.captureException(e);
            // eslint-disable-next-line no-console
            console.warn(e);
        }

        function createImpressionObj(productData, listName) {
            return {
                'event': 'eec.addToCart',
                'ecommerce': {
                    'currencyCode': 'EUR',
                    'add': {
                        'actionField': {
                            'list': listName
                        },
                        'products': [productData]
                    }
                }
            }
        }
    },

