    initHashParams: function () {
        var thiz = this;
        var url = new Url();
        var hash = url.getHash();

        if (!hash) {
            return;
        }

        var hashArray = url.getHash().split('/');

        if (hashArray.length) {
            for (var i in hashArray) {
                var tmp = hashArray[i].split('-');
                var type = tmp[0];
                switch (type) {
                    case 'param':
                        thiz.applyHashParamsToVariantFields(tmp[1], tmp[2]);
                        break;
                    case 'variant':
                        thiz.applyHashParamsToDefaultVariant(tmp[1]);
                        break;
                    case 'tab':
                        // thiz.applyHashParamsToTabs(tmp[1]);
                        break;
                    default:
                        break;
                }
            }
        }

        thiz.initHashParamsUrlChange();
    },

    initHashParamsUrlChange: function () {
        var thiz = this;
        window.onpopstate = function () {
            thiz.initHashParams();
        };
    },

    applyHashParamsToVariantFields: function (type, value) {

        var checkbox = $('input[name="' + type + '"][value="' + value + '"]');
        var select = $('select[name="' + type + '"]');

        if (checkbox.length) {
            checkbox.prop('checked', true);
        } else if (select.length) {
            select.val(value);
        }
        $('.js-variant-selector').first().change();
    },

    applyHashParamsToDefaultVariant: function (variantId) {
        var type = 'color',
            paramValue;
        if (variants[variantId].color) {
            paramValue = variants[variantId].color.id;
        } else if (variants[variantId].size) {
            paramValue = variants[variantId].size.id;
        }

        var checkbox = $('input[name="' + type + '"][value="' + paramValue + '"]');
        var select = $('select[name="' + type + '"]');

        if (checkbox.length) {
            checkbox.prop('checked', true);
        } else if (select.length) {
            select.val(paramValue);
        }
        $('.js-variant-selector').first().change();

        this.applyVariantRedesign(variants[variantId]);
        this.lastActiveVariantId = variantId;
    },

