    initLikeComment: function () {
        var $thiz = this;
        $(document).off('click', '.js-comment-like,.js-comment-dislike,.js-comment-report');
        $(document).on('click', '.js-comment-like,.js-comment-dislike,.js-comment-report', function (e) {

            if (!$thiz.getUser().isLogged()) {
                $thiz.getUser().showLoginForm('Ø§Ø¨ØªØ¯Ø§ Ø¨Ø§ÛØ¯ ÙØ§Ø±Ø¯ Ø­Ø³Ø§Ø¨ Ú©Ø§Ø±Ø¨Ø±Û Ø®ÙØ¯ Ø´ÙÛØ¯');
                return;
            }
            var url = '';
            if ($(this).hasClass('js-comment-like')) {
                url = '/ajax/product/comments/like/' + $(this).data('comment') + '/';
            } else if($(this).hasClass('js-comment-report')){
                url = '/ajax/product/comments/report/' + $(this).data('comment') + '/';
            } else {
                url = '/ajax/product/comments/dislike/' + $(this).data('comment') + '/';
            }
            var element = this;
            Services.ajaxGETRequestJSON(
                url,
                null,
                function (data) {
                    var parent = $(element).parent(".js-comment-like-container");
                    if(parent.hasClass('is-modal')) {
                        if($(element).hasClass('js-comment-like')) {
                            parent.find(".js-comment-like").toggleClass('is-active');
                            parent.find(".js-comment-dislike").removeClass('is-active');
                        } else if($(element).hasClass('js-comment-report')) {
                            parent.find(".js-comment-report").toggleClass('is-active');
                        } else {
                            parent.find(".js-comment-like").removeClass('is-active');
                            parent.find(".js-comment-dislike").toggleClass('is-active');
                        }
                        if(!$(element).hasClass('js-comment-report')){
                            parent.find(".js-comment-like").html(Services.convertToFaDigit(String(data.likes)));
                            parent.find(".js-comment-dislike").html(Services.convertToFaDigit(String(data.dislikes)));
                        }
                    } else {
                        if($(element).hasClass('js-comment-like')) {
                            parent.find(".js-comment-like").toggleClass('btn-like--positive');
                            parent.find(".js-comment-dislike").removeClass('btn-like--negative');
                        } else if($(element).hasClass('js-comment-report')) {
                            parent.find(".js-comment-report").toggleClass('is-active');
                        } else {
                            parent.find(".js-comment-like").removeClass('btn-like--positive');
                            parent.find(".js-comment-dislike").toggleClass('btn-like--negative');
                        }
                        if(!$(element).hasClass('js-comment-report')){
                            parent.find(".js-comment-like").attr('data-counter', Services.convertToFaDigit(String(data.likes)));
                            parent.find(".js-comment-dislike").attr('data-counter', Services.convertToFaDigit(String(data.dislikes)));
                        }
                    }
                },
                function (data) {
                    if (data.errors !== undefined) {
                        DKAlert(data.errors);
                    }
                }
            );

        });
    },

