    updateVariantSelectors: function () {
        var thiz = this;
        var params = thiz.getSelectedParams();

        for (var type in params) {
            $('.js-' + type + '-select').val(params[type]).selectric('refresh').change();
        }

        try {
            var variants = thiz.getVariantsBySelectedParams(params);

            var selectedVariant = thiz.selectWinnerVariant(variants, params);

            if (Object.keys(variants).length > 1) {
                window.moreSellerCount = String(Object.keys(variants).length - 1);
            }

            // try {
            //     this.sendSNTrackerProductViewEvent(Object.assign({}, variants) || {});
            // } catch (e) {
            // }

            // page load
            thiz.applyVariantRedesign(selectedVariant);
            thiz.lastActiveVariantId = selectedVariant['id'];
            thiz.applyCheapestVariant(variants);
            thiz.applyParameter(params);
            thiz.initRoostaBadge();

            if(isModuleActive('pdp_plp_special_amazing') && isModuleActive('ab_app_incredible_demo')) {
                thiz.changeAppIncredibleAction(selectedVariant['id']);
            }

            if(isModuleActive('pdp_digipay_credit_info')){
                this.initDigiPayCreditInfo(selectedVariant['id']);
            }

            thiz.initSellerCount();
            $('.js-seller-count').text(Services.convertToFaDigit(window.moreSellerCount));

        } catch (err) {
            console.warn(err);
        }
    },

