    initDigiPayCreditInfo: function(vId= null){
        var thiz = this,
            productId = $('.js-product-page').data('product-id'),
            DigiPayCreditBadge = $('.js-pdp-digipay-credit-badge'),
            DigiPayPaymentAmount = $('.js-digipay-payment-amount'),
            variantId = vId ? vId : DigiPayCreditBadge.data('variant-id'),
            DigiPayInstallmentAmount = $('.js-digipay-installment-amount');

        if(thiz.digiPayData && thiz.digiPayData[variantId]){
            DigiPayPaymentAmount.text(Services.convertToFaDigit(Services.formatCurrency(thiz.digiPayData[variantId].pre_payment_amount , true , '')));
            DigiPayInstallmentAmount.text(Services.convertToFaDigit(Services.formatCurrency(thiz.digiPayData[variantId].installment_amount , true , '')));
            DigiPayCreditBadge.removeClass('u-hidden');
        } else {
            DigiPayCreditBadge.addClass('u-hidden');
            Services.ajaxGETRequestJSON(
                '/ajax/product/digipay-credit/' + productId + '/',
                null,
                function (data) {
                    thiz.digiPayData = data;
                    if (data[variantId]){
                        DigiPayPaymentAmount.text(Services.convertToFaDigit(Services.formatCurrency(data[variantId].pre_payment_amount , true , '')));
                        DigiPayInstallmentAmount.text(Services.convertToFaDigit(Services.formatCurrency(data[variantId].installment_amount , true , '')));
                        DigiPayCreditBadge.removeClass('u-hidden');
                    } else {
                        DigiPayCreditBadge.addClass('u-hidden');
                    }
                },
                function (data) {
                    thiz.digiPayData = null;
                    DigiPayCreditBadge.addClass('u-hidden');
                    console.log('Digipay Ajax Error : ' , data.errors);
                }
            );
        }

    },

