    getVariantsBySelectedParams: function (params) {
        if (variants.length === 0) {
            throw new Error('Product does not have assigned active variants');
        }

        var foundMatches = {};

        for (var variantId in variants) {
            var isMatched = true;
            for (var n in params) {
                if (variants[variantId][n] != undefined) {
                    if (!(params[n] == variants[variantId][n]['id'] || params[n] == 0)) {
                        isMatched = false;
                    }
                }
            }

            if (isMatched) {
                foundMatches[variantId] = variants[variantId];
            }
        }

        if (Object.keys(foundMatches).length) {
            return foundMatches;
        }

        throw new Error('Cannot match params to any variant');
    },

