    initRoundProgress: function () {
        $.each($('.js-round-progress-holder .js-round-progress'), function (i, val) {
            var item = $(this);
            if(!item.attr('data-value'))
                return;
            var percent = parseFloat(item.attr('data-value'));
            var level1 = parseFloat(item.data('level-1'));
            var level2 = parseFloat(item.data('level-2'));
            var $right = item.find('.js-round-progress-right');
            var $left = item.find('.js-round-progress-left');

            if(percent == 0){
                $right.css('transform', 'rotate(180deg)');
                $left.css('transform', 'rotate(-180deg)');
            } else {
                $right.css('transform', 'rotate(0deg)');
                $left.css('transform', 'unset');
                if(percent > 50.0) {
                    $right.removeClass('less-fifty');
                    $right.css('transform', 'rotate(' + (100 - percent) * 3.6 + 'deg)');
                } else {
                    $right.addClass('less-fifty');
                    $left.css('transform', 'rotate(' + (50 - percent) * 3.6 + 'deg)');
                }
            }

            item.removeClass('red');
            item.removeClass('green');
            item.removeClass('yellow');
            if(percent > level1){
                item.addClass('green');
            } else {
                if (percent > level2){
                    item.addClass('yellow');
                } else {
                    item.addClass('red');
                }
            }

        })
    },

