    initPublicFavoriteList: function (){
        var thiz = this,
            user = this.getUser(),
            errorElement = $('.js-error-message'),
            title = $('.js-public-list-form-title'),
            modal = $('.js-public-list-modal').remodal(),
            publicListBtn = $('#add-to-public-list-button'),
            errorMessage = $('.js-public-list-error-message'),
            publicListItems = $('.js-public-list-modal-items'),
            description = $('.js-public-list-form-description'),
            productId = $('.js-product-page').data('product-id'),
            descriptionErrorMessage = $('.js-public-list-description-error-message');

        var addProductToListBtn = $('.js-add-product-to-list-submit'),
            publicList__empty = $('.js-public-list-modal--empty'),
            publicList__list = $('.js-public-list-modal--list'),
            publicList__form = $('.js-public-list-modal--form'),
            createListBtn = $('.js-public-list-create-list'),
            cancelBtn = $('.js-public-list-modal-cancel'),
            showNewListForm = $('.js-show-new-list-form');

        // local varibles
        var isEmpty = true,
            selectedLists = [],
            template_publicListItems = '',
            template = $('.js-public-list-item-template').clone()[0].innerHTML;

        // init classes
        title.removeClass('error');
        errorElement.addClass('u-hidden');
        errorMessage.addClass('u-hidden');

        // open modal and get all list
        publicListBtn.on('click', function () {
            if (!user.checkLogged()) {
                user.displayLoginForm('Ø§Ø¨ØªØ¯Ø§ Ø¨Ø§ÛØ¯ ÙØ§Ø±Ø¯ Ø­Ø³Ø§Ø¨ Ú©Ø§Ø±Ø¨Ø±Û Ø®ÙØ¯ Ø´ÙÛØ¯');
                return;
            }
            title.removeClass('error');
            errorMessage.addClass('u-hidden');
            publicList__form.addClass('u-hidden');
            Services.ajaxGETRequestJSON(
                `/ajax/wishlist/products/${productId}/`,
                {},
                function (data) {
                    var items = data.public_lists;
                    var listLen = Object.keys(items).length;
                    if (listLen > 4){
                        publicListItems.addClass('scroll');
                    } else {
                        publicListItems.removeClass('scroll');
                    }
                    if(listLen > 0){
                        isEmpty = false;
                        publicList__empty.addClass('u-hidden');
                        publicList__list.removeClass('u-hidden');
                    } else {
                        isEmpty = true;
                        publicList__list.addClass('u-hidden');
                        publicList__empty.removeClass('u-hidden');
                    }

                    publicListItems.empty();
                    template_publicListItems = '';

                    for (var item in items){
                        addItemToList(items[item]);
                    }
                    modal.open();
                },
                function (data) {
                    console.log(data.errors);
                },
                true,
                true
            );
        });

        // show new list form
        showNewListForm.on('click', function () {
            publicList__list.addClass('u-hidden');
            publicList__empty.addClass('u-hidden');
            publicList__form.removeClass('u-hidden');

            title.val('');
            description.val('');
            title.removeClass('error');
            description.removeClass('error');
            errorMessage.addClass('u-hidden');
            descriptionErrorMessage.addClass('u-hidden');
        });

        // cancel modal btn
        cancelBtn.on('click', function () {
            errorElement.addClass('u-hidden');
            publicList__form.addClass('u-hidden');
            publicList__list.addClass('u-hidden');
            publicList__empty.addClass('u-hidden');
            if(isEmpty){
                publicList__empty.removeClass('u-hidden');
            } else {
                publicList__list.removeClass('u-hidden');
            }
        });

        // create a new list
        createListBtn.on('click', function () {
            var titleValue = title.val(),
                descriptionValue = description.val();

            if(titleValue.length < 4){
                title.addClass('error');
                errorMessage.removeClass('u-hidden');
                return;
            }
            if(descriptionValue.length > 250){
                description.addClass('error');
                descriptionErrorMessage.removeClass('u-hidden');
                return;
            }

            Services.ajaxPOSTRequestJSON(
                '/ajax/profile/wishlist/',
                {
                    title: titleValue,
                    description: description.val(),
                    token: publicListBtn.data('token')
                },
                function (data) {
                    isEmpty = false;
                    publicList__form.addClass('u-hidden');
                    publicList__list.removeClass('u-hidden');
                    title.val('');
                    description.val('');
                    addItemToList(data);
                },
                function (data) {
                    // console.log("---",data.errors[0]);
                    title.addClass('error');
                    errorElement.removeClass('u-hidden');
                    errorElement.html(data.errors[0]);
                }
            );
        })

        // add product to list
        addProductToListBtn.on('click', function () {
            $.ajax({
                url: `/ajax/wishlist/products/${productId}/`,
                type: 'PUT',
                data: {
                    public_list_ids: selectedLists,
                    token: publicListBtn.data('token')
                },
                success: function (response) {
                    if(response.status){
                        modal.close();
                    }
                },
                error: function (data) {
                    console.log(data.errors);
                }
            });
        })

        // click on checkbox
        publicListItems.on('click', '.js-public-list-item', function () {
            initAllCheckBoxes();
        });

        function initAllCheckBoxes() {
            selectedLists = [];
            $('.js-public-list-item-checkbox').each(function () {
                if($(this).prop('checked') === true){
                    var listId = $(this).data('list-id');
                    selectedLists.push(listId);
                }
            });
        }

        function addItemToList(item) {
            var is_product_in_list = false;
            if("public_list_products" in item){
                var listItems = item.public_list_products;
                for (var listItem in listItems) {
                    if(listItems[listItem].is_product_in_list){
                        is_product_in_list = listItems[listItem].is_product_in_list;
                    }
                }
            }
            template_publicListItems += thiz.createTemplate(template, {
                id: item.id,
                title: item.title,
                is_product_in_list: is_product_in_list ? 'checked="true"' : ''
            })
            publicListItems.html(template_publicListItems);
        }

    },

