    initBuyNow: function() {
        var $buyNowBtn = $('.js-buy-now-trigger'),
            $BuyNowModalElement = $('[data-remodal-id=buy-it-now]'),
            buyNowModal = $BuyNowModalElement.remodal(),
            $countdown = $BuyNowModalElement.find('.js-buy-now-countdown'),
            $progressBar = $BuyNowModalElement.find('.js-buy-now-progress'),
            timeToCountdown = 30,
            remainingTime = null,
            buyNowCountdown = null;

        $buyNowBtn.on('click', function() {
            buyNowModal.open();
            if($BuyNowModalElement.hasClass('js-buy-now-first-time')) return false;

            remainingTime = timeToCountdown;

            buyNowCountdown = setInterval(
                function() {
                    remainingTime--;
                    $progressBar.css({
                        'transition-duration': timeToCountdown-1 + 's',
                        'transform': 'scaleX(0)'
                    });
                    if(remainingTime === 0) {
                        buyNowModal.close();
                    } else {
                        $countdown.text(Services.convertToFaDigit(remainingTime));
                    }

                },
                1000
            );
        });

        $BuyNowModalElement.on('closed', function() {
            if($BuyNowModalElement.hasClass('js-buy-now-first-time')) return false;
            clearInterval(buyNowCountdown);
            $countdown.text(Services.convertToFaDigit(timeToCountdown));
            $progressBar.css({
                'transform': 'scaleX(1)',
                'transition': '0s'
            });
        });
    },

