    initAdsPlacement: function () {
        var thiz = this;
        var productId = $('.js-product-page').data('product-id');
        var miniAdPlacement = $('.js-mini-buy-box-cpc-placement');
        var template = $('#product-template').clone()[0].innerHTML;

        Services.ajaxGETRequestJSON(
            '/ajax/product/cpc-ads/'+productId+'/',
            {},
            function (response) {
                var showCarousels = response.carousel;
                if(!showCarousels){
                    initMiniAd(response.mini_buy_box);
                }
                if(showCarousels){
                    initAdCarousel(response.carousels_data);
                }
                if(response.data_layer){
                    window.Main.setImpressionEventOnAjax(response.data_layer);
                }
            },
            function (response) {
                miniAdPlacement.addClass('u-hidden');
                $('#recommendation-pdp-top-rate').addClass('u-hidden');
            },
            false,
            false
        );

        function initMiniAd(data) {
            if (Object.keys(data).length === 0) {
                return;
            }

            miniAdPlacement.attr('data-id', data.id);
            miniAdPlacement.attr('data-url', data.url);
            miniAdPlacement.find('.js-title').text(data.title_fa)
            miniAdPlacement.find('.js-image').attr('src', data.image);
            miniAdPlacement.find('.js-price').text(Services.convertToFaDigit(Services.formatCurrency(data.selling_price, true, '')))
            miniAdPlacement.removeClass('u-hidden');

            if(data.impression_link) {
                var cpcImage = document.createElement('img');
                    cpcImage.classList = 'cpc-image-request';
                    cpcImage.src = data.impression_link;
                    cpcImage.alt = '';
                miniAdPlacement.append(cpcImage);
            }
        }

        function initAdCarousel(data) {
            $.map(data, function (item) {
                var products = '';
                var dom = $('#recommendation-' + item.id);
                if (dom.length > 0) {
                    dom.find('.c-title__title').html(item.title)
                    $.map(item.products, function (product) {
                        if (product.image) {
                            products += thiz.createTemplate(template, {
                                id: product.id,
                                url: product.url,
                                image: product.image,
                                title: product.title,
                                isFMCG: (product.fast_shopping_badge ? '' : 'u-hidden'),
                                discount: Services.convertToFaDigit(product.price.discount_percent),
                                hasDiscount: (product.price.discount_percent > 0 ? '' : 'u-hidden'),
                                oldValue: Services.convertToFaDigit(Services.formatCurrency(product.price.rrp_price, true, '')),
                                price: Services.convertToFaDigit(Services.formatCurrency(product.price.selling_price, true, '')),
                            });
                        }
                    });
                    dom.find('.js-products-container').html(products);
                    $.map(dom.find('.js-template-img'), function (item) {
                        $(item).attr('src', $(item).data('img'));
                    });
                    dom.removeClass('u-hidden');

                    if(item.impression_link) {
                        var cpcImage = document.createElement('img');
                            cpcImage.classList = 'cpc-image-request';
                            cpcImage.src = item.impression_link;
                            cpcImage.alt = '';
                        dom.append(cpcImage);
                    }

                    new window.Swiper(dom.find('.swiper-container'), {
                        slidesPerView: 6,
                        slidesPerGroup: 5,
                        lazy: {
                            enabled: true
                        },
                        navigation: {
                            nextEl: ".js-swiper-button-next",
                            prevEl: ".js-swiper-button-prev"
                        },
                        keyboard: {
                            enabled: true,
                            onlyInViewport: true
                        },
                        breakpoints: {
                            1367: {
                                slidesPerView: 4,
                                slidesPerGroup: 3,
                                spaceBetweenSlides: 1
                            },
                            1679: {
                                slidesPerView: 5,
                                slidesPerGroup: 4,
                                spaceBetweenSlides: 1
                            }
                        },
                    });
                }
            });
        }

        miniAdPlacement.on('click', function () {
            var thiz = $(this);
            var url = thiz.data('url');
            window.open(url, '_blank');
        })

    },

