function initQuickView(variant) {
    var $quickAddToCart = $('.js-quick-add-to-cart');
    var variantId = variant['id'];
    $quickAddToCart.empty();
    $('<option>').val(0).text('Ø­Ø°Ù').appendTo($quickAddToCart);
    for (var i = 1; i <= variant['price_list']['orderLimit']; i++) {
        $('<option>').val(i).text(Services.convertToFaDigit(i) + " Ø¹Ø¯Ø¯").appendTo($quickAddToCart);
    }

    $quickAddToCart.data('variant', variantId);
    if (!!window.cart.variants[variantId]) {
        $quickAddToCart.data('cart-item', window.cart.variants[variantId]['cartItemId']);
        $quickAddToCart.data('mode', 'change');
        $quickAddToCart.val(!!window.cart.variants[variantId] ? window.cart.variants[variantId]['quantity'] : 1);
        $quickAddToCart.closest('.js-add-to-cart-container').addClass('is-added');
        $('.js-product-page-add-to-card').hide();
        $('.js-select-quantity').show().css('display', 'flex');
    } else {
        $quickAddToCart.data('mode', 'add');

        if(isModuleActive('buy_now_btn')) {
            $('.js-product-page-add-to-card').show().css('display', 'flex');
        } else {
            $('.js-product-page-add-to-card').show().css('display', 'block');
        }

        $quickAddToCart.closest('.js-add-to-cart-container').removeClass('is-added');
        $('.js-select-quantity').hide();
    }

    if (!!variant['fast_shopping_confirm']) {
        $quickAddToCart.closest('.js-add-to-cart-container').addClass('js-fast-shopping-confirm');
    } else {
        $quickAddToCart.closest('.js-add-to-cart-container').removeClass('js-fast-shopping-confirm');
    }

    $quickAddToCart.selectric('refresh');
}